(146,	'Wound: Battle of Trost District, Part 8',	'The plan to reclaim Trost falls apart when Eren''s newfound powers turn him into a mindless giant. As Titans continue to swarm the city, it''s up to Armin and Mikasa to make sure the cadets massacred during the mission haven''t died in vain. ',	60,	NULL,	NULL,	5,	20,	1,	12),
(155,	'Da Tou Kyou',	'With a new enemy revealed, Eren and the Scouts fight back using all the techniques at their disposal. However, the Armored and Colossal Titan have other plans in mind. ',	60,	NULL,	NULL,	5,	20,	2,	7),
(164,	'Go for it din lille slut',	'Sana and Vilde wants Eva to get in touch with Christoffer in the third year, to get them invited to a party with the third year boys, among them the most popular boy in school William. ',	60,	NULL,	NULL,	5,	21,	1,	4),
(75,	'The Happiness of All Mankind',	'Valery and Boris attempt to find solutions to removing the radioactive debris; Ulana attempts to find out the cause of the explosion. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	9,	1,	4),
(76,	'Islands',	'Wildlife documentary series with David Attenborough, beginning with a look at the remote islands which offer sanctuary to some of the planet''s rarest creatures. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	10,	1,	1),
(77,	'Mountains',	'The wildlife documentary series with David Attenborough continues with a unique and intimate glimpse into secretive lives of mountain-dwelling animals. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	10,	1,	2),
(78,	'Jungles',	'Jungles provide the richest habitats on the planet - mysterious worlds of high drama where extraordinary animals attempt to survive in the most competitive place on earth.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	10,	1,	3),
(79,	'Deserts',	'The world''s deserts force animals to come up with ingenious ways of coping with hostile conditions, giving rise to the most incredible survival stories on earth. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	10,	1,	4),
(81,	'Cities',	'Cities are the newest habitat on Planet Earth. The series documents the wildlife in our cities. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	10,	1,	6),
(11,	'You Win or You Die',	'Robert has been injured while hunting and is dying. Jon and the others finally take their vows to the Night''s Watch. A man, sent by Robert, is captured for trying to poison Daenerys. Furious, Drogo vows to attack the Seven Kingdoms. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	1,	7),
(12,	'The Pointy End',	'The Lannisters press their advantage over the Starks; Robb rallies his father''s northern allies and heads south to war; The White Walkers attack the Wall; Tyrion returns to his father with some new friends. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	1,	8),
(13,	'Baelor',	'Robb goes to war against the Lannisters. Jon finds himself struggling on deciding if his place is with Robb or the Night''s Watch. Drogo has fallen ill from a fresh battle wound. Daenerys is desperate to save him. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	1,	9),
(14,	'Fire and Blood',	'Robb vows to get revenge on the Lannisters. Jon must officially decide if his place is with Robb or the Night''s Watch. Daenerys says her final goodbye to Drogo. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	1,	10),
(16,	'The Night Lands',	'Arya makes friends with Gendry. Tyrion tries to take control of the Small Council. Theon arrives at his home, Pyke, in order to persuade his father into helping Robb with the war. Jon tries to investigate Craster''s secret. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	2,	2),
(17,	'What Is Dead May Never Die',	'Tyrion tries to see who he can trust in the Small Council. Catelyn visits Renly to try and persuade him to join Robb in the war. Theon must decide if his loyalties lie with his own family or with Robb. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	2,	3),
(18,	'Garden of Bones',	'Lord Baelish arrives at Renly''s camp just before he faces off against Stannis. Daenerys and her company are welcomed into the city of Qarth. Arya, Gendry, and Hot Pie find themselves imprisoned at Harrenhal. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	2,	4),
(19,	'The Ghost of Harrenhal',	'Tyrion investigates a secret weapon that King Joffrey plans to use against Stannis. Meanwhile, as a token for saving his life, Jaqen H''ghar offers to kill three people that Arya chooses. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	2,	5),
(20,	'The Old Gods and the New',	'Theon seizes control of Winterfell. Jon captures a wildling, named Ygritte. The people of King''s Landing begin to turn against King Joffrey. Daenerys looks to buy ships to sail for the Seven Kingdoms. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	2,	6),
(21,	'A Man Without Honor',	'Bran and Rickon have escaped Winterfell. Theon tries to hunt them down. Daenerys'' dragons have been stolen. Jon travels through the wilderness with Ygritte as his prisoner. Sansa has bled and is now ready to have Joffrey''s children.',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	2,	7),
(22,	'The Prince of Winterfell',	'Stannis is just days from King''s Landing. Tyrion prepares for his arrival. Jon and Qhorin are taken prisoner by the wildlings. Catelyn is arrested for releasing Jaime. Arya, Gendry, and Hot Pie plan to escape from Harrenhal. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	2,	8),
(23,	'Blackwater',	'Stannis Baratheon''s fleet and army arrive at King''s Landing and the battle for the city begins. Cersei plans for her and her children''s future. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	2,	9),
(24,	'Valar Morghulis',	'Joffrey puts Sansa aside for Margaery Tyrell. Robb marries Talisa Maegyr. Jon prepares to meet Mance Rayder. Arya says farewell to Jaqen H''ghar. Daenerys tries to rescue her dragons. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	2,	10),
(25,	'Valar Dohaeris',	'Jon is brought before Mance Rayder, the King Beyond the Wall, while the Night''s Watch survivors retreat south. In King''s Landing, Tyrion asks for his reward. Littlefinger offers Sansa a way out. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	3,	1),
(26,	'Dark Wings, Dark Words',	'Bran and company meet Jojen and Meera Reed. Arya, Gendry, and Hot Pie meet the Brotherhood. Jaime travels through the wilderness with Brienne. Sansa confesses her true feelings about Joffery to Margaery. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	3,	2),
(6,	'The Kingsroad',	'While Bran recovers from his fall, Ned takes only his daughters to King''s Landing. Jon Snow goes with his uncle Benjen to the Wall. Tyrion joins them. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	1,	2),
(5,	'Winter Is Coming',	'Eddard Stark is torn between his family and an old friend when asked to serve at the side of King Robert Baratheon; Viserys plans to wed his sister to a nomadic warlord in exchange for an army. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	1,	1),
(27,	'Walk of Punishment',	'Robb and Catelyn arrive at Riverrun for Lord Hoster Tully''s funeral. Tywin names Tyrion the new Master of Coin. Arya says goodbye to Hot Pie. The Night''s Watch returns to Craster''s. Brienne and Jaime are taken prisoner. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	3,	3),
(29,	'Kissed by Fire',	'Robb''s army is falling apart. Jaime reveals a story, to Brienne, that he has never told anyone. Jon breaks his vows. The Hound is granted his freedom. The Lannisters hatch a new plan. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	3,	5),
(30,	'The Climb',	'Jon and the wildlings scale the Wall. The Brotherhood sells Gendry to Melisandre. Robb does what he can to win back the Freys. Tyrion tells Sansa about their engagement. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	3,	6),
(31,	'The Bear and the Maiden Fair',	'Jon and the wildlings travel south of the Wall. Talisa tells Robb that she''s pregnant. Arya runs away from the Brotherhood. Daenerys arrives at Yunkai. Jaime leaves Brienne behind at Harrenhal. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	3,	7),
(32,	'Second Sons',	'Daenerys tries to persuade the Second Sons to join her against Yunkai. Stannis releases Davos from the dungeons. Sam and Gilly are attacked by a White Walker. Sansa and Tyrion wed. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	3,	8),
(33,	'The Rains of Castamere',	'Robb and Catelyn arrive at the Twins for the wedding. Jon is put to the test to see where his loyalties truly lie. Bran''s group decides to split up. Daenerys plans an invasion of Yunkai. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	3,	9),
(34,	'Mhysa',	'Bran and company travel beyond the Wall. Sam returns to Castle Black. Jon says goodbye to Ygritte. Jaime returns to King''s Landing. The Night''s Watch asks for help from Stannis. ',	60,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	6,	3,	10),
(35,	'Pilot',	'Diagnosed with terminal lung cancer, chemistry teacher Walter White teams up with his former student, Jesse Pinkman, to cook and sell crystal meth. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	8,	1,	1),
(36,	'Cat''s in the Bag...',	'After their first drug deal goes terribly wrong, Walt and Jesse are forced to deal with a corpse and a prisoner. Meanwhile, Skyler grows suspicious of Walt''s activities.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	8,	1,	2),
(37,	'...And the Bag''s in the River',	'As Jesse struggles to sell the meth he and Walter made, the chemistry teacher faces his own dilemmas, such as hiding his cancer from his wife and deciding what to do with Jesse''s prisoner Krazy-8. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	8,	1,	3),
(38,	'Cancer Man',	'Walt tells the rest of his family about his cancer. Jesse tries to make amends with his own parents. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	8,	1,	4),
(53,	'Phoenix',	'Walt and Skyler have a baby girl. Now that Jesse is hooked on heroin, Walt refuses to give him his money until he gets clean. Meanwhile, as an excuse for his money, Walt decides to donate the money to himself through his son''s new website. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	8,	2,	12),
(84,	'Carentan',	'Easy Company takes on German troops in the French town of Carentan, and the battle takes its toll on one soldier who is badly traumatized by the experience. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	11,	1,	3),
(85,	'Replacements',	'With the addition of many new men, Easy Company heads to Holland to participate in Operation Market Garden and prepare an Allied route into Germany, but they meet stiff German resistance. ',	3599,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	11,	1,	4),
(86,	'Crossroads',	'Winters writes a report on the challenge of an unexpected resistance to a German attack, and is haunted by his conscience after shooting a teenage German SS soldier. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	11,	1,	5),
(87,	'Bastogne',	'It''s Christmas 1944, and the 101st is surrounded by Germans in the forest outside of Bastogne with a lack of supplies in bitter cold and snow.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	11,	1,	6),
(88,	'The Breaking Point',	'Easy Company remains in the Ardennes Forest preparing for an inevitable attack on German forces in the town of Foy. However, morale is low due to cold weather, constant shelling, poor leadership, and numerous casualties. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	11,	1,	7),
(89,	'The Last Patrol',	'Easy Company is in Hagenau in Feburary 1945, where they prepare for a night patrol mission to capture German prisoners. The patrol includes one veteran who is despised for missing Bastogne and a new lieutenant fresh out of West Point. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	11,	1,	8),
(90,	'Why We Fight',	'As the Allies move into Germany and the war comes closer to an end, disillusionment and anger set in for Easy Company - until they stumble onto a concentration camp abandoned by the German military.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	11,	1,	9),
(91,	'Points',	'As the Germans surrender, it appears that the hard days for Easy Company are over as they are stationed in Austria. But they soon learn that those solders without enough service points will be sent to fight in Japan. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	11,	1,	10),
(92,	'The Target',	'altimore Det. Jimmy McNulty finds himself in hot water with his superior Major William Rawls after a drug dealer, D''Angelo Barksdale who is charged with three murders, is acquitted. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	1,	1),
(93,	'The Detail',	'Lt. Daniels puts his team together but the extra help he''s asked includes several less than stellar officers. It also includes McNulty, who is obviously in the doghouse.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	1,	2),
(94,	'The Buys',	'After two weeks on the job, the team still doesn''t have a photo of their principal target, Avon Barksdale. Freamon has a solution when he hears Avon was a Gold Gloves boxer. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	1,	3),
(95,	'Old Cases',	'Bodie walks out of detention pretending to be a janitor but Patty is recovering in hospital and is pleased that his injuries will result in a medical pension.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	1,	4),
(96,	'The Pager',	'von Barksdale is becoming paranoid and thinks he''s being watched. He''s also worried his phone is being tapped. He also thinks there''s a snitch in D''Angelo''s crew and he''s told not to pay anyone until it''s sorted.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	1,	5),
(97,	'The Wire',	'Avon takes care of Omar''s man Brandon but Wallace, who saw Brandon in the arcade, isn''t too comfortable when he sees what they''ve done to him. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	1,	6),
(98,	'One Arrest',	'Burrell reluctantly sides with Daniels in the disagreement with Rawls, giving the detail more time to make a case against Avon, despite his fears the operation is beginning to sprawl.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	1,	7),
(99,	'Ebb Tide',	'Detective Jimmy McNulty finds the body of a woman floating in the water while carrying out his new assignment of Harbor Patrol.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	2,	1),
(101,	'Collateral Damage',	'Major Valchek gets back at Sobotka for the church gift fiasco, and a feud begins. Avon Barksdale continues to run his empire from a prison cell.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	2,	2),
(102,	'Hot Shots',	'Lt Cedric Daniels lets it be known he is going to leave the department. McNulty pursues the identity of the Jane Doe found floating in the harbor. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	2,	3),
(103,	'Hard Cases',	'McNulty goes on a self-assigned moral mission to identify his floater, but his old partner, Bunk, says they have more pressing matter at hand: finding Omar to testify against a Barksdale trigger man in one of last year''s murders.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	12,	2,	4),
(105,	'A New Germany: 1933-1939',	'Program chronicles the draconian measures taken by Adolf Hitler to become absolute dictator of Germany and begin his domination of Europe. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	1),
(106,	'Distant War: September 1939-May 1940',	'France and Great Britain enter World War 2 following Germany''s invasion of Poland. But with the exception of its navy Britain is rather uncertain how to prepare. After a failed operation in Norway lead by Churchill, Chamberlain is, ironically.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	2),
(107,	'France Falls: May-June 1940',	'As their forces invade Northern Europe German strategists capitalize time and again on French preconceptions confounding French defenses. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	3),
(108,	'Alone: May 1940-May 1941',	'In the end of May 1940, when the last French cities are captured by the Germans, half a million British and French soldiers retreat to the last channel port still open to them: Dunkerque. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	4),
(109,	'Barbarossa: June-December 1941',	'Following the conquest of France Hitler, almost casually by blitzkrieg standards, turn his eyes toward Russia. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	5),
(110,	'Banzai! Japan: 1931-1942',	'Following Japan''s conquest of eastern Asia the Allies finally respond with sanctions. They prove so threatening to Japan that it prepares to conquer Southeast Asia to secure the resources it needs.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	6),
(111,	'On Our Way: U.S.A. - 1939-1942',	'Although those in the know figured it was just a matter of time, the United States only reluctantly participated in World War 2.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	7),
(112,	'The Desert: North Africa - 1940-1943',	'In 1940 Mussolini deploys a massive army to invade British held Egypt, to capture the Suez Canal and most of all to establish an Italian empire to rival Germany''s.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	8),
(113,	'Stalingrad: June 1942-February 1943',	'Germany is dealt a crushing defeat when the Russians'' stubborn defense of Stalingrad delays the German offensive giving the Russians time to mass their forces for a counter attack that surrounds then destroys the German Sixth.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	9),
(114,	'Wolf Pack: U-Boats in the Atlantic - 1939-1944',	'For three years German u-boats ravage transatlantic convoys. Despite the critical need for the supplies and materiel British leadership give scant attention to the matter for two years.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	10),
(115,	'Red Star: The Soviet Union - 1941-1943',	'Bent on fulfilling Hilter''s policy of colonizing Russia, German forces invade subjecting inhabitants of occupied lands to servitude or death.',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	11),
(116,	'Whirlwind: Bombing Germany - September 1939-April 1944',	'While the British continue to rely on night bombing the American forces attempt to use more dangerous but more precise daylight bombing to interdict German military production and crush the national will. ',	3600,	'2019-02-01 00:00:00',	'2019-01-01 00:00:00',	5,	16,	1,	12),
(129,	'Avatar Roku: Winter Solstice, Part 2',	'To contact the spirit of the previous Avatar, Aang must reach a temple in the Fire Nation before the sun sets on the following day. There he will learn what he must do to restore balance to the world. Zuko must defy his banishment to follow Aang. ',	30,	NULL,	NULL,	5,	18,	1,	8),
(138,	'The Night of the Closing Ceremony: Humanity''s Comeback, Part 2',	'Annie proves her skill in a sparring session, Jan dreams of serving alongside the King, and graduation day brings shocking revelations - along with a sudden outbreak of violence. ',	60,	NULL,	NULL,	5,	20,	1,	4),
(147,	'Primal Desires: Battle of Trost District, Part 9',	'Jean manages to get another Maneuver Gear from a dead soldier and escape thanks to Annie, Connie, and Marco distracting the Titans. ',	60,	NULL,	NULL,	5,	20,	1,	13),
(156,	'Ou Mono',	'Without a way to pursue the Titans, the Scouts have no choice but to recuperate as they wait for reinforcements. But do they still have faith in Eren? ',	60,	NULL,	NULL,	5,	20,	2,	8),
(165,	'Hva er det som gj√∏r deg k√•t?',	'Eva invites Jonas for dinner to meet her mom. Vilde is falling for William, and the girls visits the school doctor to get contraceptives because Vilde has decided she wants to lose her virginity. ',	60,	NULL,	NULL,	5,	21,	1,	5),
(173,	'The Interview',	'ark wants Jeremy to get a job in the same office as him so he can pay his share of the rent, however Jeremy isn''t keen on the idea. Mark also worries whether Sophie, a co-worker he fancies, may or may not think he''s a Nazi.',	60,	NULL,	NULL,	5,	22,	1,	2),
(181,	'Main Justice',	'When the team attends the White House Correspondents'' Dinner in Washington, Mac makes an unexpected acquaintance and Will gets a surprise. ',	60,	NULL,	NULL,	5,	23,	1,	3);
