(4,	'Avengers: Endgame',	'After the devastating events of Vengadores: Infinity War (2018), the universe is in ruins. With the help of remaining allies, the Avengers assemble once more in order to undo Thanos'' actions and restore order to the universe. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BMTc5MDE2ODcwNV5BMl5BanBnXkFtZTgwMzI2NzQ2NzM@._V1_SY1000_CR0,0,674,1000_AL_.jpg',	181,	NULL,	5,	'Anthony Russo',	'2019-04-25',	'<iframe src="https://www.imdb.com/videoembed/vi2163260441" allowfullscreen width="854" height="400"></iframe>'),
(5,	'Extremely Wicked, Shockingly Evil and Vile',	'A courtroom frenzy ensues and sweeps 1970s America when a young single mother reluctantly tips the attention of a widespread manhunt toward her longtime boyfriend, Ted Bundy. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BMjM4ZjY5ZmQtNjUwYi00Yzk2LWIwNmMtYTg1NmU0MWExZTMzXkEyXkFqcGdeQXVyMTg2MDEyMzM@._V1_SY1000_CR0,0,675,1000_AL_.jpg',	110,	NULL,	5,	'Joe Berlinger',	'2019-05-03',	'<iframe src="https://www.imdb.com/videoembed/vi1726266649" allowfullscreen width="854" height="400"></iframe>'),
(12,	'Liu lang di qiu',	'As the sun is dying out, people all around the world build giant planet thrusters to move Earth out of its orbit and sail Earth to a new star system. Yet the 2500-year journey comes with unexpected dangers, and in order to save humanity, a group of young people in this age of a wandering Earth fight hard for the survival of humankind. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BMjE2NzZlMGItMzA4OS00ZjRiLTk3NzItMDRkOGFlZmNhYzJkXkEyXkFqcGdeQXVyNzI1NzMxNzM@._V1_SY1000_CR0,0,714,1000_AL_.jpg',	125,	NULL,	5,	'Frant Gwo',	'2019-04-01',	'<iframe src="https://www.imdb.com/videoembed/vi2657663513" allowfullscreen width="854" height="400"></iframe>'),
(7,	'Pok√©mon Detective Pikachu',	'In a world where people collect Pok√©mon to do battle, a boy comes across an intelligent talking Pikachu who seeks to be a detective. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BNDU4Mzc3NzE5NV5BMl5BanBnXkFtZTgwMzE1NzI1NzM@._V1_SY1000_CR0,0,674,1000_AL_.jpg',	104,	NULL,	5,	'Rob Letterman',	'2019-05-10',	'<iframe src="https://www.imdb.com/videoembed/vi3254238233" allowfullscreen width="854" height="400"></iframe>'),
(6,	'Spider-Man: Far From Home',	'Following the events of Avengers: Endgame, Spider-Man must step up to take on new threats in a world that has changed forever. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BZjBhYWNiMDQtYjRmYy00NzEzLTg1MDYtYzg3YzRkZmRkYjY3XkEyXkFqcGdeQXVyNjg2NjQwMDQ@._V1_SY1000_CR0,0,674,1000_AL_.jpg',	NULL,	NULL,	5,	'Jon Watts',	'2019-06-05',	'<iframe src="https://www.imdb.com/videoembed/vi2600385561" allowfullscreen width="854" height="400"></iframe>'),
(8,	'Green Book ',	'A working-class Italian-American bouncer becomes the driver of an African-American classical pianist on a tour of venues through the 1960s American South. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BYzIzYmJlYTYtNGNiYy00N2EwLTk4ZjItMGYyZTJiOTVkM2RlXkEyXkFqcGdeQXVyODY1NDk1NjE@._V1_SY1000_CR0,0,666,1000_AL_.jpg',	130,	NULL,	5,	'Peter Farrelly',	'2019-02-01',	'<iframe src="https://www.imdb.com/videoembed/vi824752921" allowfullscreen width="854" height="400"></iframe>'),
(16,	'A Dog''s Journey',	'A dog finds the meaning of his own existence through the lives of the humans he meets.',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BOTI0NTk0ODE4OV5BMl5BanBnXkFtZTgwNDQxOTgyNzM@._V1_SY1000_CR0,0,631,1000_AL_.jpg',	108,	NULL,	5,	'Gail Mancuso',	'2019-06-14',	'<iframe src="https://www.imdb.com/videoembed/vi722450969" allowfullscreen width="854" height="400"></iframe>'),
(15,	'The Intruder',	'A young married couple buy a beautiful house on several acres of land only to find out that the man they bought it from refuses to let go of the property. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BMzg1ZjcxNjgtMTliNC00NzU3LWE3NGMtZTBjMWFmYzk4OWE0XkEyXkFqcGdeQXVyMDA4NzMyOA@@._V1_SY1000_CR0,0,674,1000_AL_.jpg',	102,	NULL,	5,	'Deon Taylor',	'2019-05-06',	'<iframe src="https://www.imdb.com/videoembed/vi512670745" allowfullscreen width="854" height="400"></iframe>'),
(10,	'Shazam!',	'We all have a superhero inside us, it just takes a bit of magic to bring it out. In Billy Batson''s case, by shouting out one word - SHAZAM. - this streetwise fourteen-year-old foster kid can turn into the grown-up superhero Shazam. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BYTE0Yjc1NzUtMjFjMC00Y2I3LTg3NGYtNGRlMGJhYThjMTJmXkEyXkFqcGdeQXVyNTI4MzE4MDU@._V1_SY1000_CR0,0,674,1000_AL_.jpg',	132,	NULL,	5,	'David F. Sandberg',	'2019-04-05',	'<iframe src="https://www.imdb.com/videoembed/vi306231833" allowfullscreen width="854" height="400"></iframe>'),
