INSERT INTO "Serie" ("id", "name", "description", "created_at", "updated_at", "image", "duration", "rating", "user_id", "trailer") VALUES
(16,	'The World at War',	'A  groundbreaking 26-part documentary series narrated by the actor Laurence Olivier about the deadliest conflict in history, World War II. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BYzExN2NhZDctOWEzMy00NzYwLTg3MDktNjYyNTQyOWY4MGYwXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SY1000_CR0,0,722,1000_AL_.jpg',	54,	NULL,	5,	NULL),
(18,	'Avatar: The Last Airbender',	'In a war-torn world of elemental magic, a young boy reawakens to undertake a dangerous mystic quest to fulfill his destiny as the Avatar, and bring peace to the world. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BNzZlZmQyYTgtOWNmMy00NTNhLTgyOTYtNjhiOTllOGU2MDg5XkEyXkFqcGdeQXVyMjYxMzY2NDk@._V1_.jpg',	30,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi4010411801" allowfullscreen width="854" height="400"></iframe>'),
(8,	'Breaking Bad',	'A high school chemistry teacher diagnosed with inoperable lung cancer turns to manufacturing and selling methamphetamine in order to secure his family''s future.',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BMjhiMzgxZTctNDc1Ni00OTIxLTlhMTYtZTA3ZWFkODRkNmE2XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_SY1000_CR0,0,718,1000_AL_.jpg',	46,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi338798873" allowfullscreen width="854" height="400"></iframe>'),
(19,	'The Sopranos',	'New Jersey mob boss Tony Soprano deals with personal and professional issues in his home and business life that affect his mental state, leading him to seek professional psychiatric counseling. ',	'2019-05-16 08:18:23',	'2019-05-16 08:18:23',	'https://m.media-amazon.com/images/M/MV5BZGJjYzhjYTYtMDBjYy00OWU1LTg5OTYtNmYwOTZmZjE3ZDdhXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SY1000_CR0,0,702,1000_AL_.jpg',	60,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi993638937" allowfullscreen width="854" height="400"></iframe>'),
(20,	'Shingeki no kyojin',	'After his hometown is destroyed and his mother is killed, young Eren Yeager vows to cleanse the earth of the giant humanoid Titans that have brought humanity to the brink of extinction.',	'2019-05-16 08:18:23',	'2019-05-16 08:18:23',	'https://m.media-amazon.com/images/M/MV5BMTY5ODk1NzUyMl5BMl5BanBnXkFtZTgwMjUyNzEyMTE@._V1_.jpg',	24,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi1401073433" allowfullscreen width="854" height="400"></iframe>'),
(21,	'Skam',	'The story of young teenagers and pupils on Hartvig Nissens upper secondary school in Oslo, and their troubles, scandals and everyday life. Each season is told from a different person''s point of view.',	'2019-05-16 08:18:23',	'2019-05-16 08:18:23',	'https://m.media-amazon.com/images/M/MV5BYjY5OGI0NmMtZTI2Zi00MmZjLTk5ZjYtZDk0YjM0YjFiZThiXkEyXkFqcGdeQXVyMzk4ODI0MzM@._V1_SY1000_CR0,0,680,1000_AL_.jpg',	NULL,	NULL,	5,	NULL),
(22,	'Peep Show',	'Mark and Jez are a couple of twenty-something roommates who have nothing in common - except for the fact that their lives are anything but normal. Mayhem ensues as the pair strive to cope with day-to-day life.',	'2019-05-16 08:18:23',	'2019-05-16 08:18:23',	'https://m.media-amazon.com/images/M/MV5BZjYwMWJhOWMtZTc5ZC00MGY0LTg0ZjktMzFhODhhZGZhNDRjXkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_.jpg',	NULL,	NULL,	5,	NULL),
(7,	'iZombie  ',	'A medical resident finds that being a zombie has its perks, which she uses to assist the police. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BZWNhODE4NzAtN2JjOC00ODJjLThhNzAtMWM1NDg4ZDQxNzMzXkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_SY1000_SX800_AL_.jpg',	42,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi672248601" allowfullscreen width="854" height="400"></iframe>'),
(6,	'Game of Thrones',	'Nine noble families fight for control over the mythical lands of Westeros, while an ancient enemy returns after being dormant for thousands of years. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BMjA5NzA5NjMwNl5BMl5BanBnXkFtZTgwNjg2OTk2NzM@._V1_SY1000_CR0,0,674,1000_AL_.jpg',	NULL,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi3672620057" allowfullscreen width="854" height="400"></iframe>'),
(9,	'Chernobyl',	'In April 1986, an explosion at the Chernobyl nuclear power plant in the Union of Soviet Socialist Republics becomes one of the world''s worst man-made catastrophes. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BNTEyYmIzMDUtNWMwNC00Y2Q1LWIyZTgtMGY1YzUxOTAwYTAwXkEyXkFqcGdeQXVyMjIyMTc0ODQ@._V1_SY1000_CR0,0,674,1000_AL_.jpg',	3600,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi3724524825" allowfullscreen width="854" height="400"></iframe>'),
(10,	'Planet Earth II',	'David Attenborough returns in this breathtaking documentary showcasing life on Planet Earth. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BZWYxODViMGYtMGE2ZC00ZGQ3LThhMWUtYTVkNGE3OWU4NWRkL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMjYwNDA2MDE@._V1_SY1000_CR0,0,666,1000_AL_.jpg',	3600,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi2095757337" allowfullscreen width="854" height="400"></iframe>'),
(11,	'Band of Brothers',	'The story of Easy Company of the U.S. Army 101st Airborne Division, and their mission in World War II Europe, from Operation Overlord, through V-J Day. ',	'2019-01-01 00:00:00',	'2019-02-01 00:00:00',	'https://m.media-amazon.com/images/M/MV5BMTI3ODc2ODc0M15BMl5BanBnXkFtZTYwMjgzNjc3._V1_.jpg',	3600,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi3629711385" allowfullscreen width="854" height="400"></iframe>'),
