(25,	'Berserk',	'Guts is a skilled swordsman who joins forces with a mercenary group named ''The Band of the Hawk'', lead by the charismatic Griffith, and fights with them as they battle their way into the royal court.',	'2019-05-16 08:18:23',	'2019-05-16 08:18:23',	'https://m.media-amazon.com/images/M/MV5BYWE1YTU4NmYtMTY2Ni00NDIxLTgwMzYtNWJjYWE4MDE5OTE1XkEyXkFqcGdeQXVyNjc2NjA5MTU@._V1_.jpg',	NULL,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi515506457" allowfullscreen width="854" height="400"></iframe>'),
