(34,	'Dexter',	'By day, mild-mannered Dexter is a blood-spatter analyst for the Miami police. But at night, he is a serial killer who only targets other murderers.',	'2019-05-16 08:18:23',	'2019-05-16 08:18:23',	'https://m.media-amazon.com/images/M/MV5BMTM5MjkwMTI0MV5BMl5BanBnXkFtZTcwODQwMTc0OQ@@._V1_.jpg',	60,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi2270077465" allowfullscreen width="854" height="400"></iframe>'),
(35,	'Young Justice',	'eenage superheroes strive to prove themselves as members of the Justice League. ',	'2019-05-16 08:18:23',	'2019-05-16 08:18:23',	'https://m.media-amazon.com/images/M/MV5BYjZmODVjMWQtOTMzYS00ZjIwLWJhODQtM2IyMzAyMzYwZDQwXkEyXkFqcGdeQXVyMzIxOTM0ODM@._V1_SY1000_CR0,0,696,1000_AL_.jpg',	60,	NULL,	5,	'<iframe src="https://www.imdb.com/videoembed/vi3933314585" allowfullscreen width="854" height="400"></iframe>'),
